import React from "react";

export default function login() {
  return (
    <div>
      <div class="card w-75">
        <div class="card-body">
          <h5 class="card-title">Card title</h5>
          <p class="card-text">
            With supporting text below as a natural lead-in to additional
            content.
          </p>
          <a href="#" class="btn btn-primary">
            Button
          </a>
        </div>
      </div>
    </div>
  );
}
